package practicepaper2onconditionalstatement;

public class TestQ43 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int A=10;
		if(10L== A)
		{
			System.out.println("10l");
		}
		if(10==A)
		{
			System.out.println("10");
		}
		else
		{
			System.out.println("0");
		}

	}

}
